import Footer from "../../components/Footer";
import income from "../../assets/income.png"

const IncomeInfo = () => {
    
    return(
        <>
        <NavBar/>
            <Box bgColor={"#F5F7FA"} bgSize={"cover"} paddingTop={"100px"} height={"100vh"}>  
