                            <Image src={income} width={"100px"} height={"35px"}/>
                        </Box>

                        <Box bgColor={"#F5F7FA"} width={"300px"} height={"100px"}>

                        </Box>      

                        <Box bgColor={"#F5F7FA"} width={"300px"} height={"100px"}>

                        </Box>    
                    </Flex>
                </Box>    
            </Box>   
        <Footer/> 
        </>
    )
};

export default IncomeInfo;
